import React from 'react';

import './rosters.styles.scss';

export const Rosters = ({team, userTeam, opponentTeam}) =>{
    return (
        <div className='rosters'>
            {team==='user' ? 
            Object.keys(userTeam).map(ele=><div>{ele+':'+ userTeam[ele]['name']===undefined ? '' : userTeam[ele]['name']}</div>) : 
            Object.keys(opponentTeam).map(ele=><div>{ele+':'+ opponentTeam[ele]['name']===undefined ? '' : opponentTeam[ele]['name']}</div>) }
        </div>
    )
}
